import classNames from "classnames/bind";
import {Link} from "react-router-dom"

import styles from "./Menu.module.scss";

const cx = classNames.bind(styles);

function MenuItem({data, title}) {
    return ( 
            <select className={cx("menu-item")}>
                <option>{cx("title")}</option>
                {
                    data.map((item, index) => (
                        <option key={index}> 
                            <span className = {cx("icont")}> {item.icont} </span>
                            <Link to={item.href} className = {cx("value")}> {item.value}</Link>
                        </option>
                    ))
                }
            </select>
     );
}

export default MenuItem;
